ngsVersion 2.55ICJOFD+WingdingsThe Windows logo is a trademark of Microsoft Corporation.Microsoft TypographyKris Holmes and Charles BigelowThe Wingdings fonts were designed by Kris Holmes and Charles Bigelow in\r\n1990 and 1991. The fonts were originally named Lucida Icons, Arrows, and Stars to complement the Lucida text font family by the same designers. Renamed, reorganized, and released in 1992 as Microsoft Wingdings(TM), the three fonts provide a harmoniously designed set of icons representing the common components of personal computer systems and the elements of graphical user interfaces. There are icons for PC, monitor, keyboard, mouse, trackball, hard drive, diskette, tape cassette, printer, fax, etc., as well as icons for file folders, documents, mail, mailboxes, windows, clipboard, and wastebasket. In addition, Wingdings includes icons with both traditional and computer significance, such as writing tools and hands, reading glasses, clipping scissors, bell, bomb, check boxes, as well as more traditional images such as weather signs, religious symbols, astrological signs, encircled numerals, a selection of ampersands and interrobangs, plus elegant flowers and flourishes. Pointing and indicating are frequent functions in graphical interfaces, so in adition to a wide selection of pointing hands, the Wingdings fonts also offer arrows in careful gradations of weight and different directions and styles. For variety and impact as bullets, asterisks, and ornaments, Windings also offers a varied set of geometric circles, squares, polygons, targets, and stars.http://www.microsoft.com/truetype/fonts/wingdings/http://www.microsoft.com/truetype/designers/bandh/\0n\0o\0r\0m\0a\0l\0S\0t\0a\0n\0d\0a\0r\0d\0C\0o\0p\0y\0r\0i\0g\0h\0t\0 \0\0 \01\09\09\02\0-\01\09\09\05\0 \0M\0i\0c\0r\0o\0s\0o\0f\0t\0 \0C\0o\0r\0p\0.\0 \0A\0l\0l\0 \0R\0i\0g\0h\0t\0s\0 \0R\0e\0s\0e\0r\0v\0e\0d\0.\0 \0\0 \01\09\09\00\0-\01\09\09\01\0 \0T\0y\0p\0e\0 \0S\0o\0l\0u\0t\0i\0o\0n\0s\0,\0 \0I\0n\0c\0.\0